 ('2', '2', 'en_us', 'Thomas Joeisseint', '<p>Hola que tal ??</p>\n<p><br /></p>', '\"If you aren\'t, at any given time, scandalized by code you wrote five or even three years ago, you\'re not learning anywhere near enough\"', ' - Nick Black', 'Constantly looking for new ways to improve my work, and new challenges to solve, I enjoy working with cutting edge technologies, using engineering best practices to ensure the viability, robustness and scalability of my work. Always willing to learn and better myself, I strongly believe that adaptability is a must, and, team cooperation along with communication the key factors to success.', '1992-01-02 00:00:00', 'Here is my web resume to know more about my experiences and projects as a software engineer, specialized in backend web development.', 'Thomas Joeisseint - Software engineer', '\"Any fool can write code that a computer can understand. Good programmers write code that humans can understand\"', '- Martin Fowler', '2017-09-30 23:21:59', '2017-11-29 04:06:20', 'f6899460-e73b-46e3-98f1-71cb78d42f7b'),
