INSERT INTO `craft_matrixcontent_experiences` (`id`, `elementId`, `locale`, `field_experience_jobTitle`, `field_experience_company`, `field_experience_dates`, `field_experience_description`, `field_experience_technos`, `field_experience_icon`, `dateCreated`, `dateUpdated`, `uid`) VALUES
 ('1', '43', 'en_us', 'Fullstack Developer', 'Nurun Montréal', 'February 2016 - Present', '<p>Backend development of large scale websites and REST APIs. <br />Using engineering best practices: agile methodology, unit testing, continuous deployment, design pattern.<br /></p>', 'CraftCms - Drupal - CakePhp - Spring - Apache Sling - Ansible - Vagrant - Docker - Jenkins - Freemarker', 'glyphicon-briefcase', '2017-10-06 01:09:03', '2017-11-29 04:06:20', '9ab62e04-97dc-418d-a808-5e985713f652'),
 ('2', '44', 'en_us', 'Backend intern', 'Nurun Montréal', 'June 2015 - September 2015', '<p>Website development with Laravel, database modeling, environment configuration.<br />Development of a Java automation testing tool for mobile devices.</p>', 'Laravel - Ansible - Vagrant - Java', 'glyphicon-pencil', '2017-10-06 01:11:41', '2017-11-29 04:06:20', '4e8f902b-55f7-4c51-b1ba-1063efbfdc8a'),
 ('3', '45', 'en_us', 'Laboratory internship on object tracking algorithms', 'LITIV Laboratory, Polytechnique Montreal', 'January 2014 - April 2015', '<p>Use evaluation framework in order to make a benchmark comparison between tracking algorithms on 360° camera. <br /><a href=\"http://arxiv.org/abs/1505.04502\" target=\"_blank\" rel=\"noreferrer noopener\">Research paper published</a></p>', 'Matlab - C++', 'glyphicon-pencil', '2017-10-06 01:15:44', '2017-11-29 04:06:20', '779ca4ba-8d52-42ee-97d7-23dcc8df152d'),
 ('4', '46', 'en_us', 'One year International exchange program', 'Polytechnique Montreal', '2014 - 2015', '<p>Exchange for two semesters.</p>', 'Artificial intelligence - Machine learning - Software Testing - Team management - Accounting', 'glyphicon-education', '2017-10-06 01:15:44', '2017-11-29 04:06:20', 'd4c37209-724f-4c36-8de3-b60e51865abe'),
 ('5', '47', 'en_us', 'Software engineer intern', 'Miami University', 'May 2014 - August 2014', '<p>Conception and implementation of users redirecting algorithms. Improvement of the redirected walking to support multi-user connected to the network. <br /><a href=\"http://hive.teams.csi.muohio.edu\" target=\"_blank\" rel=\"noreferrer noopener\">HIVE website</a></p>', 'C++ - Unity - C#', 'glyphicon-pencil', '2017-10-06 01:23:44', '2017-11-29 04:06:20', 'd5fd6b5e-df44-4f58-a3c3-d0f0dae8847c'),
 ('6', '48', 'en_us', 'Bachelor & Master degree in computer science engineering', 'Graduate School of Engineering of the University of Nantes', '2010 - 2015', '<p>Major : Systems and networks.<br />Manager of the school cafeteria for a year.</p>', 'Software development - Database modeling - Artificial intelligence - Business intelligence - Project management - Communication - Accounting', 'glyphicon-education', '2017-10-06 01:23:44', '2017-11-29 04:06:20', '057c1698-952b-4b64-bd80-3f9ff532b94e'),
 ('7', '100', 'en_us', 'Research on Automatic detection of adult content in web images', 'Ars Nova System', 'September 2013 – April 2014', '<p>Developed C++ image processing algorithms to build metrics feeding a supervised machine learning algorithm, in order to classify images. Created mathematical and statistical models for data analysis, and automate processes for easy integration. Close work with client, demo and sprint planning every month.</p>', 'C++ - Bash/Shell - PHP - Matlab - Orange data mining', 'glyphicon-pencil', '2017-11-29 03:53:37', '2017-11-29 04:06:20', '9a5ddf7e-a3f1-40ca-b8c6-261869a5e2ff');



