 ('1', '91', 'en_us', 'Huge Immersive Virtual Environment', 'Miami University research project allowing several people to navigate naturally in VR worlds by being physically tracked.', 'http://hive.teams.csi.muohio.edu/', '2017-10-28 14:58:30', '2017-11-29 04:06:20', 'b67cea8c-4997-4fd7-ac84-706f6f4f71f6'),
 ('2', '94', 'en_us', 'Tracking evaluation on 360 camera', 'LITIV Laboratory research on evaluation framework for tracking algorithms.', 'http://arxiv.org/abs/1505.04502', '2017-10-28 16:12:41', '2017-11-29 04:06:20', '2672691d-9ed2-4b04-9d6d-2b5b15b9ab31'),
